import React from 'react';
import './styles/main.scss';
import Header from './header/Header'
import {Switch, Route} from 'react-router-dom'
import home from './homepage/Home';

function App() {
  return (
    <div>
      <Switch>
        <Route exact path="/" component={home}></Route>
      </Switch>
    </div>
  );
}

export default App;
